  false,\n\t\"url\": null,\n\t\"notes\": \"Physical factors, such as the slope of
  the land, the texture of the soil, and the precipitation regime influence erosion
  in an area. Parts of Puerto Rico are very steep and erosion-prone. In addition,
  the nature of the soil and intense rainfall events promote severe erosion in these
  areas. Erosion can be extreme in exposed areas (cleared for a road or residential
  construction, or where soil is exposed due to cropping patterns or agricultural
  cycle.)\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
